import React from 'react';

import { useState, useEffect } from 'react';

const Fetch = () => {
  const [photos, setPhotos] = useState([]);
  useEffect(() => {
    fetch('http://127.0.0.1:8000//api/lift/config/')
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        console.log(data);
        setPhotos(data);
      });
  }, []);
  return (
    <div>
        <p></p>
    </div>
  );
};
export default Fetch;
